[Form]
public class TMSParameters extends FormRun
{
    boolean                             runExecuteDirect;
    TmpIdRef                            tmpIdRef;

    NumberSeqScope                      scope;
    NumberSeqApplicationModule          numberSeqApplicationModule;
    container                           numberSequenceModules;

}

public void init()
{
    this.numberSeqPreInit();

    TMSParameters::find();

    super();

    this.numberSeqPostInit();

    SustainabilityConfiguration.visible(TMSSustainabilityIntegrationFeature::instance().isEnabled());
}

void numberSeqPreInit()
{
    runExecuteDirect   = false;

    numberSequenceModules = [NumberSeqModule::TMS];
    numberSeqApplicationModule = new TMSNumberSeqModuleTMS();
    scope = NumberSeqScopeFactory::createDataAreaScope();
    NumberSeqApplicationModule::createReferencesMulti(numberSequenceModules, scope);
    tmpIdRef.setTmpData(NumberSequenceReference::configurationKeyTableMulti(numberSequenceModules));
}

void executeQuery()
{
    if (runExecuteDirect)
    {
        super();
    }
    else
    {
        runExecuteDirect = true;
        this.queryRun(NumberSeqReference::buildQueryRunMulti(numberSequenceReference,
                                                             tmpIdRef,
                                                             numberSequenceTable,
                                                             numberSequenceModules,
                                                             scope));
        numbersequenceReference_ds.research();
    }
}

int  active()
{
    int ret;

    ret = super();

    buttonNumberSequenceGroup.enabled(numberSequenceReference.groupEnabled());

    return ret;
}

public display TaxBookSectionId taxBookSectionId()
{
    if (NumberSequenceTable.RecId)
    {
        return TaxBookSection::findVoucherSeries(NumberSequenceTable.RecId).TaxBookSectionId;
    }

    return '';
}

public boolean modified()
{
    boolean ret;

    ret = super();

    element.showVendorInvoice(TMSParameters.WriteInvoiceJournal);

    return ret;
}

void clicked()
{
    DialogButton                        result;
    System.Exception                    ex;

    super();

    result = Box::yesNo("@TRX2592", DialogButton::No);

    if (result == DialogButton::Yes)
    {
        try
        {
            TMSICommandInitializeBaseData initializeBaseDataCommand = TMSCommandInitializeBaseDataFactory::createCommand();
            initializeBaseDataCommand.Execute();
            info("@TRX2594");
        }
        catch (Exception::CLRError)
        {
            ex = ClrInterop::getLastException();
            if (ex != null)
            {
                ApplicationUnhandledExceptionLogger::logCLRException(ex);
                ex = ex.get_InnerException();
            }
        }
        catch
        {
            error("@TRX2595");
        }

        if (ex != null)
        {
            TMSErrorLog::createLogEntry(ex);
            error(ex.get_Message());
        }
    }
}

void clicked()
{
    PrintMgmtSetupContext   setupContext = new PrintMgmtSetupContext();

    super();

    setupContext.addHierarchyContext(PrintMgmtHierarchyType::TMS, PrintMgmtNodeType::TMS);
    setupContext.parmCaller(element);
    setupContext.parmReferencedTableBuffer(null);
    PrintMgmt::launchSetup(setupContext);
}

